INSERT INTO `cmf_caipiao` VALUES (1,'一分快三','一分快三','一分快三','faster than three','Satu minit lebih cepat daripada tiga','/static/caipiao/yfks.png','1440','1','f1k3',0,'<p>     <strong>一分快三玩法说明</strong><br/> </p> <p>     “一分快三”为引进欧洲菠菜公司开奖设定，由菲律宾博彩营业执照公司审核监控，联合开发的彩票游戏。该游戏全天24小时开奖，每分钟一期，全天共1440期。 </p> <p>     <strong>具体规则如下：</strong> </p> <ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\">     <li>         <p>             <strong>两面</strong>         </p>         <p>             <strong>·小：</strong> 三粒骰子之点数总和由4点-10点         </p>         <p>             <strong>·大：</strong>&nbsp;三粒骰子之点数总和由11点-17点         </p>         <p>             <strong>·单：</strong>&nbsp;三粒骰子之点数总和为单数         </p>         <p>             <strong>·双：</strong>&nbsp;三粒骰子之点数总和为双数         </p>     </li>     <li>         <p>             <strong>总和</strong>         </p>         <p>             <strong>·</strong>由4点指17点，三粒骰子平面点数之总和         </p>     </li>     <li>         <p>             <strong>单骰</strong>         </p>         <p>             <strong>·</strong>任何一粒骰子出现选定之平面点数         </p>     </li>     <li>         <p>             <strong>对子</strong>         </p>         <p>             <strong>·</strong>当期开奖号码中由两个号码相同即为对子，且投注号码与档期开奖对子号码相符，即为中奖         </p>     </li>     <li>         <p>             <b>豹子</b>         </p>         <p>             <strong>·</strong>当期开奖号码的三个号码相同，且投注号码与当期开奖号码相符，即为中奖。若开出为豹子为111和666，通杀大、小、单、双、对子、总和         </p>     </li> </ol>','<p>\r\n    <strong>一分快三玩法說明</strong><br/>\r\n</p>\r\n<p>\r\n    “一分快三”為引進歐洲菠菜公司開獎設定，由菲律賓博彩營業執照公司稽核監控，聯合開發的彩票遊戲。 該遊戲全天24小時開獎，每分鐘一期，全天共1440期。\r\n</p>\r\n<p></p>\r\n<p>\r\n    具體規則如下：\r\n</p>\r\n<p>\r\n    兩面\r\n</p>\r\n<p>\r\n    ·小：三粒骰子之點數總和由4點-10點\r\n</p>\r\n<p>\r\n    ·大：三粒骰子之點數總和由11點-17點\r\n</p>\r\n<p>\r\n    ·單：三粒骰子之點數總和為單數\r\n</p>\r\n<p>\r\n    ·雙：三粒骰子之點數總和為雙數\r\n</p>\r\n<p>\r\n    總和\r\n</p>\r\n<p>\r\n    ·由4點指17點，三粒骰子平面點數之總和\r\n</p>\r\n<p>\r\n    單骰\r\n</p>\r\n<p>\r\n    ·任何一粒骰子出現選定之平面點數\r\n</p>\r\n<p>\r\n    對子\r\n</p>\r\n<p>\r\n    ·當期開獎號碼中由兩個號碼相同即為對子，且投注號碼與檔期開獎對子號碼相符，即為中獎\r\n</p>\r\n<p>\r\n    豹子\r\n</p>\r\n<p>\r\n    ·當期開獎號碼的三個號碼相同，且投注號碼與當期開獎號碼相符，即為中獎。 若開出為豹子為111和666，通殺大、小、單、雙、對子、總和\r\n</p>\r\n<p>\r\n    <ul>\r\n        <li>\r\n            <p></p>\r\n        </li><br/>\r\n    </ul>\r\n</p>','<p>\r\n    <strong>One point, three quick instructions</strong><br/>\r\n</p>\r\n<p>\r\n    &quot;One point, fast three&quot; is a lottery game jointly developed by the Philippine Gambling Business License Company for the introduction of European spinach companies. The game is open 24 hours a day, one issue per minute, 1440 issues in total.\r\n</p>\r\n<p></p>\r\n<p>\r\n    The specific rules are as follows:\r\n</p>\r\n<p>\r\n    two sides\r\n</p>\r\n<p>\r\n    ·Small: the total number of points of three dice is from 4 to 10\r\n</p>\r\n<p>\r\n    ·Large: the total number of points of three dice ranges from 11 to 17\r\n</p>\r\n<p>\r\n    ·Single: The sum of the three dice is odd\r\n</p>\r\n<p>\r\n    ·Double: the sum of the three dice is even\r\n</p>\r\n<p>\r\n    the sum\r\n</p>\r\n<p>\r\n    ·From 4 points to 17 points, the sum of the plane points of three dice\r\n</p>\r\n<p>\r\n    Single die\r\n</p>\r\n<p>\r\n    ·The number of selected plane points on any die\r\n</p>\r\n<p>\r\n    Pair\r\n</p>\r\n<p>\r\n    ·If the two numbers in the current lottery number are the same, they are the pairs, and the betting number is consistent with the number of the scheduled lottery pair, they are the winners\r\n</p>\r\n<p>\r\n    leopard\r\n</p>\r\n<p>\r\n    ·The three numbers of the current lottery number are the same, and the betting number is consistent with the current lottery number. If the number of leopards is 111 and 666, the total number of big, small, single, double, pair and total\r\n</p>\r\n<p>\r\n    <ul>\r\n        <li>\r\n            <p></p>\r\n        </li><br/>\r\n    </ul>\r\n</p>','<p>\r\n    <strong>Satu titik, tiga arahan cepat</strong><br/>\r\n</p>\r\n<p>\r\n    &quot;Satu titik, cepat tiga&quot; adalah permainan loteri yang dikembangkan bersama-sama oleh Philippine Gambling Business License Company untuk perkenalan syarikat spinach Eropah. Permainan terbuka 24 jam sehari, satu isu per minit, 1440 isu total.\r\n</p>\r\n<p></p>\r\n<p>\r\n    Peraturan khusus adalah seperti ini:\r\n</p>\r\n<p>\r\n    dua sisi\r\n</p>\r\n<p>\r\n    ·Kecil: jumlah titik tiga dadu adalah dari 4 hingga 10\r\n</p>\r\n<p>\r\n    ·Besar: jumlah titik tiga dadu berjulat dari 11 hingga 17\r\n</p>\r\n<p>\r\n    ·Satu: Jumlah tiga dadu adalah pelik\r\n</p>\r\n<p>\r\n    ·Gandakan: jumlah tiga dadu adalah sama\r\n</p>\r\n<p>\r\n    jumlah\r\n</p>\r\n<p>\r\n    ·Dari 4 titik ke 17 titik, jumlah titik pesawat tiga dadu\r\n</p>\r\n<p>\r\n    Mati tunggal\r\n</p>\r\n<p>\r\n    ·Bilangan titik kapal terbang yang dipilih pada setiap mati\r\n</p>\r\n<p>\r\n    Pasangan\r\n</p>\r\n<p>\r\n    ·Jika dua nombor dalam nombor loteri semasa adalah sama, mereka adalah pasangan, dan nombor taruhan adalah konsisten dengan nombor pasangan loteri dijadwalkan, mereka adalah pemenang\r\n</p>\r\n<p>\r\n    leopard\r\n</p>\r\n<p>\r\n    ·Tiga nombor nombor loteri semasa adalah sama, dan nombor taruhan konsisten dengan nombor loteri semasa. Jika bilangan leopard adalah 111 dan 666, bilangan total besar, kecil, tunggal, ganda, pasangan dan total\r\n</p>\r\n<p>\r\n    <ul>\r\n        <li>\r\n            <p></p>\r\n        </li><br/>\r\n    </ul>\r\n</p>','1',1701276910),(2,'一分时时彩','一分时时彩','一分時時彩','Timely color','Satu sen loteri','/static/caipiao/yfssc.png','1440','1','xjssc',1,NULL,NULL,NULL,NULL,'1',1701276931),(3,'一分赛车','一分赛车','一分賽車','cycle racing','Satu perlumbaan mata','/static/caipiao/yfsc.png','1440','1','xypk10',1,'<p>     <strong>一分赛车玩法说明</strong> </p> <p>     “一分赛车”为引进欧洲菠菜公司开奖设定，由菲律宾菠菜执照公司审核监控，联合开发的彩票游戏。该游戏全天24小时开奖，每分钟一期，全天1440期。 </p> <p>     <br/> </p> <p>     <strong>具体规则如下：</strong> </p> <p>     <strong>&nbsp; &nbsp; 1.冠亚和</strong> </p> <p>     <strong>&nbsp; &nbsp; &nbsp; &nbsp;· <strong style=\"white-space: normal;\">冠亚和：</strong></strong>开出冠军车号与亚军车号的总和 </p> <p>     <strong><strong style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;·&nbsp;<strong>冠亚和大小：</strong></strong></strong>开出冠亚军车号的总和大于等于12为大，开出冠亚军车号的总和小于等于11为小 </p> <p>     &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong style=\"white-space: normal;\"><strong>&nbsp;·&nbsp;<strong>冠亚和单双：</strong></strong></strong>开出冠亚军车号的总和为单数为单，开出冠亚军车号的总和为双数为双 </p> <p>     &nbsp; &nbsp; <strong>2.</strong><strong style=\"white-space: normal;\">冠亚大小单双</strong> </p> <p>     &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>· 大小：</strong> 开出之冠军号码大于或等于6为大，小于或等于5为小<br/> </p> <p>     &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>· 单双：</strong>冠军号码为双数叫双，如4，8；冠军号码为单数叫单，如5，9<br/> </p> <p>     &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>· 组合：</strong>大小单双进行组合，分为大单，大双，小单，小双。如6为单数，并且为双数，即为大双；5为小，并且为单数，即为小单<br/> </p> <p>     &nbsp;&nbsp;&nbsp;&nbsp;<strong>3.冠军</strong><br/> </p> <p>     &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>&nbsp;· 猜冠军：</strong>开奖结果竞猜车号对应所采惯出车道视为中奖，其余情形视为不中奖 </p>','<p>\r\n    一分賽車玩法說明\r\n</p>\r\n<p>\r\n    “一分賽車”為引進歐洲菠菜公司開獎設定，由菲律賓菠菜執照公司稽核監控，聯合開發的彩票遊戲。 該遊戲全天24小時開獎，每分鐘一期，全天1440期。\r\n</p>\r\n<p>\r\n    具體規則如下：\r\n</p>\r\n<p>\r\n    1.冠亞和\r\n</p>\r\n<p>\r\n    ·冠亞和：開出冠軍車號與亞軍車號的總和\r\n</p>\r\n<p>\r\n    ·冠亞和大小：開出冠亞軍車號的總和大於等於12為大，開出冠亞軍車號的總和小於等於11為小\r\n</p>\r\n<p>\r\n    ·冠亞和單雙：開出冠亞軍車號的總和為單數為單，開出冠亞軍車號的總和為雙數為雙\r\n</p>\r\n<p>\r\n    2.冠亞大小單雙\r\n</p>\r\n<p>\r\n    ·大小：開出之冠軍號碼大於或等於6為大，小於或等於5為小\r\n</p>\r\n<p>\r\n    ·單雙：冠軍號碼為雙數叫雙，如4，8； 冠軍號碼為單數叫單，如5，9\r\n</p>\r\n<p>\r\n    ·組合：大小單雙進行組合，分為大單，大雙，小單，小雙。 如6為單數，並且為雙數，即為大雙； 5為小，並且為單數，即為小單\r\n</p>\r\n<p>\r\n    3.冠軍\r\n</p>\r\n<p>\r\n    ·猜冠軍：開獎結果競猜車號對應所采慣出車道視為中獎，其餘情形視為不中獎\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>','<p>\r\n    One-point racing game description\r\n</p>\r\n<p>\r\n    &quot;One point racing&quot; is a lottery game jointly developed by the Philippine spinach license company for the introduction of European spinach companies. The game is open 24 hours a day, one issue per minute, 1440 issues a day.\r\n</p>\r\n<p>\r\n    The specific rules are as follows:\r\n</p>\r\n<p>\r\n    1. Guanya and\r\n</p>\r\n<p>\r\n    ·Guan Yahe: the sum of the number of the champion car and the number of the runner-up car\r\n</p>\r\n<p>\r\n    ·Guanya and size: the sum of the number of Guanya military vehicles is greater than or equal to 12, and the sum of the number of Guanya military vehicles is smaller than or equal to 11\r\n</p>\r\n<p>\r\n    ·Guanya and single and double: the sum of the number of Guanya military vehicles issued is odd, and the sum of the number of Guanya military vehicles issued is double\r\n</p>\r\n<p>\r\n    2. Guanya, single and double in size\r\n</p>\r\n<p>\r\n    ·Size: the number of the champion issued is larger than or equal to 6, and smaller than or equal to 5\r\n</p>\r\n<p>\r\n    ·Single and double: the champion number is double, such as 4, 8; The champion number is singular, such as 5, 9\r\n</p>\r\n<p>\r\n    ·Combination: The combination of large and small single and double is divided into big single, big double, small single and small double. If 6 is odd and even, it is big double; 5 is small and singular, that is, small order\r\n</p>\r\n<p>\r\n    3. Champions\r\n</p>\r\n<p>\r\n    ·Guess the winner: the result of the lottery will be regarded as winning the prize if the vehicle number corresponding to the chosen lane, and the rest will be regarded as not winning the prize\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>','<p>\r\n    Huraian permainan perlumbaan satu titik\r\n</p>\r\n<p>\r\n    &quot;One point racing&quot; adalah permainan loteri yang dikembangkan bersama-sama oleh syarikat lesen spinach Filipina untuk perkenalan syarikat spinach Eropah. Permainan terbuka 24 jam sehari, satu isu setiap minit, 1440 isu sehari.\r\n</p>\r\n<p>\r\n    Peraturan khusus adalah seperti ini:\r\n</p>\r\n<p>\r\n    1. Guanya dan\r\n</p>\r\n<p>\r\n    ·Guan Yahe: jumlah nombor kereta juara dan nombor kereta runner-up\r\n</p>\r\n<p>\r\n    ·Guanya dan saiz: jumlah kenderaan tentera Guanya lebih besar atau sama dengan 12, dan jumlah kenderaan tentera Guanya lebih kecil atau sama dengan 11\r\n</p>\r\n<p>\r\n    ·Guanya dan satu dan ganda: jumlah kenderaan tentera Guanya yang dikeluarkan adalah pelik, dan jumlah kenderaan tentera Guanya yang dikeluarkan adalah ganda\r\n</p>\r\n<p>\r\n    2. Guanya, satu dan ganda dalam saiz\r\n</p>\r\n<p>\r\n    ·Saiz: bilangan juara yang dikeluarkan lebih besar daripada atau sama dengan 6, dan lebih kecil daripada atau sama dengan 5\r\n</p>\r\n<p>\r\n    ·Satu dan ganda: nombor juara adalah ganda, seperti 4, 8; Nombor juara adalah unik, seperti 5, 9\r\n</p>\r\n<p>\r\n    ·Kombinasi: Kombinasi yang besar dan kecil tunggal dan ganda dibahagi menjadi tunggal besar, ganda besar, tunggal kecil dan ganda kecil. Jika 6 adalah pelik dan bahkan, ia adalah ganda besar; 5 adalah kecil dan unik, iaitu, tertib kecil\r\n</p>\r\n<p>\r\n    3. Juara\r\n</p>\r\n<p>\r\n    ·Tebak pemenang: hasil loteri akan dianggap sebagai memenangi hadiah jika nombor kenderaan yang sepadan dengan jalur yang dipilih, dan yang lain akan dianggap sebagai tidak memenangi hadiah\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>','1',1701276872),(4,'一分快乐十分','一分快乐十分','一分快樂十分','happy ten','Satu minit kebahagiaan adalah sepuluh','/static/caipiao/yfks.png','1440','1','yfssc',1,NULL,NULL,NULL,NULL,'1',1701276892),(5,'一分六合彩','一分六合彩','一分六合彩','Liuhecai','Satu mata dan enam loteri','/static/caipiao/yflhc.png','1440','1','dflhc',1,'<p>     <strong>一分六合彩玩法说明</strong> </p> <p>     “一分六合彩”为引进欧洲菠菜公司开奖设定，由菲律宾菠菜执照公司审核监控，联合开发的彩票游戏。该游戏全天24小时开奖，每分钟一期，全天1440期。 </p> <p>     <br/> </p> <p>     <strong>具体规则如下：</strong> </p> <p>     <strong>&nbsp; &nbsp; 1.特码</strong> </p> <p>     <strong>&nbsp; &nbsp; &nbsp; &nbsp;·</strong>一分六合彩公司当期开出的最后一码为特码 </p> <p>     &nbsp; &nbsp; <strong>2.特码两面</strong> </p> <p>     &nbsp; &nbsp; &nbsp; &nbsp;<strong>·特码大小：</strong> 开出的特码，小于或等于24（01-24）为特小；小于或等于48并且大于等于25（25-48）为特大，如开出特码49，大小不吃页不赔，退回下注大小的筹码。 </p> <p>     &nbsp; &nbsp; &nbsp; &nbsp;<strong style=\"white-space: normal;\">·特码单双：</strong>&nbsp;开出的特码为双数叫特双，如18，20，34，42；开出的特码为单数叫特单，如01，11，35，47；如开出特码49，单数不吃也不赔，退回下注单数的筹码。 </p> <p style=\"white-space: normal;\">     &nbsp; &nbsp;&nbsp;<strong>3.特码生肖</strong> </p> <p style=\"white-space: normal;\">     &nbsp; &nbsp; &nbsp; &nbsp;<strong>·生肖顺序为：</strong>&nbsp; 鼠&gt;牛&gt;虎&gt;兔&gt;龙&gt;蛇&gt;马&gt;羊&gt;猴&gt;鸡&gt;狗&gt;猪 </p> <p style=\"white-space: normal;\">     <strong style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;·若当期特码，落在下注生肖范围内，是为中奖</strong> </p> <p style=\"white-space: normal;\">     <strong style=\"white-space: normal;\">&nbsp; &nbsp; 4.特码色波</strong> </p> <p style=\"white-space: normal;\">     <strong style=\"white-space: normal;\">&nbsp; &nbsp; &nbsp; &nbsp;·</strong>极速六合彩49个号码球分别由红、蓝、绿三种颜色，以特码开出的颜色和投注的颜色是为中奖，颜色代表如下： </p> <p style=\"white-space: normal;\">     &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>·红波：</strong>01，02，07，08，12，13，18，19，23，24，29，30，34，35，40，45，46 </p> <p style=\"white-space: normal;\">     <strong style=\"white-space: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;·蓝波：</strong>03，04，09，10，14，15，20，25，26，31，36，37，41，42，47，48 </p> <p style=\"white-space: normal;\">     &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong style=\"white-space: normal;\">·绿波：</strong>05，06，11，16，17，21，22，27，28，32，33，38，39，43，44，49 </p> <p style=\"white-space: normal;\">     &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; </p> <p style=\"white-space: normal;\">     <br/> </p> <p>     &nbsp; &nbsp; &nbsp; </p> <p></p>','<p>\r\n    <strong>一分六合彩玩法說明</strong>\r\n</p>\r\n<p>\r\n    “一分六合彩”為引進歐洲菠菜公司開獎設定，由菲律賓菠菜執照公司稽核監控，聯合開發的彩票遊戲。 該遊戲全天24小時開獎，每分鐘一期，全天1440期。\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>\r\n<p></p>\r\n<p>\r\n    具體規則如下：\r\n</p>\r\n<p>\r\n    1.特碼\r\n</p>\r\n<p>\r\n    ·一分六合彩公司當期開出的最後一碼為特碼\r\n</p>\r\n<p>\r\n    2.特碼兩面\r\n</p>\r\n<p>\r\n    ·特碼大小：開出的特碼，小於或等於24（01-24）為特小； 小於或等於48並且大於等於25（25-48）為特大，如開出特碼49，大小不吃頁不賠，退回下注大小的籌碼。\r\n</p>\r\n<p>\r\n    ·特碼單雙：開出的特碼為雙數叫特雙，如18，20，34，42； 開出的特碼為單數叫特單，如01，11，35，47； 如開出特碼49，單數不吃也不賠，退回下注單數的籌碼。\r\n</p>\r\n<p>\r\n    3.特碼生肖\r\n</p>\r\n<p>\r\n    ·生肖順序為：鼠&gt;牛&gt;虎&gt;兔&gt;龍&gt;蛇&gt;馬&gt;羊&gt;猴&gt;雞&gt;狗&gt;猪\r\n</p>\r\n<p>\r\n    ·若當期特碼，落在下注生肖範圍內，是為中獎\r\n</p>\r\n<p>\r\n    4.特碼色波\r\n</p>\r\n<p>\r\n    ·極速六合彩49個號碼球分別由紅、藍、綠三種顏色，以特碼開出的顏色和投注的顏色是為中獎，顏色代表如下：\r\n</p>\r\n<p>\r\n    ·紅波：01，02，07，08，12，13，18，19，23，24，29，30，34，35，40，45，46\r\n</p>\r\n<p>\r\n    ·藍波：03，04，09，10，14，15，20，25，26，31，36，37，41，42，47，48\r\n</p>\r\n<p>\r\n    ·綠波：05，06，11，16，17，21，22，27，28，32，33，38，39，43，44，49\r\n</p>\r\n<p style=\"white-space: normal;\">\r\n    &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;\r\n</p>\r\n<p style=\"white-space: normal;\">\r\n    <br/>\r\n</p>\r\n<p>\r\n    &nbsp; &nbsp; &nbsp;\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>','<p></p>\r\n<p>\r\n    Description of one-point six-point lottery\r\n</p>\r\n<p>\r\n    &quot;One point and six lottery&quot; is a lottery game jointly developed by the Philippine spinach license company, which is set for the introduction of European spinach companies. The game is open 24 hours a day, one issue per minute, 1440 issues a day.\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>\r\n<p></p>\r\n<p>\r\n    The specific rules are as follows:\r\n</p>\r\n<p>\r\n    1. Special code\r\n</p>\r\n<p>\r\n    ·The last code issued by the company in the current period is a special code\r\n</p>\r\n<p>\r\n    2. Two sides of special code\r\n</p>\r\n<p>\r\n    ·Special code size: the special code issued is very small if it is less than or equal to 24 (01-24); If it is less than or equal to 48 and greater than or equal to 25 (25-48), it is extra large. If the special code 49 is issued, it will not be compensated for the size of the page, and the chips of the size of the bet will be returned.\r\n</p>\r\n<p>\r\n    ·Special code single and double: the special code issued is called special double, such as 18, 20, 34, 42; The special code issued is an odd number called special order, such as 01, 11, 35, 47; If you issue a special code of 49, you will neither eat nor lose the odd number, and you will return the chips of the odd number.\r\n</p>\r\n<p>\r\n    3. Special Chinese zodiac\r\n</p>\r\n<p>\r\n    ·The order of the zodiac is: rat&gt;ox&gt;tiger&gt;rabbit&gt;dragon&gt;snake&gt;horse&gt;sheep&gt;monkey&gt;chicken&gt;dog&gt;pig\r\n</p>\r\n<p>\r\n    ·If the special code of the current period falls within the range of betting on the Chinese zodiac, it is a lottery\r\n</p>\r\n<p>\r\n    4. Special color wave\r\n</p>\r\n<p>\r\n    ·The 49 number balls of the Super Speed Liuhe Color are respectively red, blue and green. The color of the special code and the color of the bet are the winning colors. The color representation is as follows:\r\n</p>\r\n<p>\r\n    ·Red wave: 01, 02, 07, 08, 12, 13, 18, 19, 23, 24, 29, 30, 34, 35, 40, 45, 46\r\n</p>\r\n<p>\r\n    ·Blue wave: 03, 04, 09, 10, 14, 15, 20, 25, 26, 31, 36, 37, 41, 42, 47, 48\r\n</p>\r\n<p>\r\n    ·Green wave: 05, 06, 11, 16, 17, 21, 22, 27, 28, 32, 33, 38, 39, 43, 44, 49\r\n</p>\r\n<p style=\"white-space: normal;\">\r\n    &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;\r\n</p>\r\n<p style=\"white-space: normal;\">\r\n    <br/>\r\n</p>\r\n<p>\r\n    &nbsp; &nbsp; &nbsp;\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>','<p></p>\r\n<p>\r\n    Huraian loteri enam titik satu-titik\r\n</p>\r\n<p>\r\n    &quot;Satu titik dan enam loteri&quot; adalah permainan loteri yang dikembangkan bersama-sama oleh syarikat lesen spinach Filipina, yang ditetapkan untuk perkenalan syarikat spinach Eropah. Permainan terbuka 24 jam sehari, satu isu setiap minit, 1440 isu sehari.\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>\r\n<p></p>\r\n<p>\r\n    Peraturan khusus adalah seperti ini:\r\n</p>\r\n<p>\r\n    1. Kod khas\r\n</p>\r\n<p>\r\n    ·Kod terakhir yang dikeluarkan oleh syarikat dalam masa semasa adalah kod istimewa\r\n</p>\r\n<p>\r\n    2. Dua sisi kod istimewa\r\n</p>\r\n<p>\r\n    ·Saiz kod istimewa: kod istimewa yang dikeluarkan adalah sangat kecil jika ia kurang dari atau sama dengan 24 (01-24); Jika ia kurang dari atau sama dengan 48 dan lebih daripada atau sama dengan 25 (25-48), ia adalah lebih besar. Jika kod istimewa 49 dikeluarkan, ia tidak akan dikumpensasikan untuk saiz halaman, dan cip saiz taruhan akan dikembalikan.\r\n</p>\r\n<p>\r\n    ·Kod khas tunggal dan ganda: kod khas yang dikeluarkan dipanggil ganda khas, seperti 18, 20, 34, 42; Kod istimewa yang dikeluarkan adalah nombor pelik yang dipanggil perintah istimewa, seperti 01, 11, 35, 47; Jika and a mengeluarkan kod istimewa 49, anda tidak akan makan atau kehilangan nombor pelik, dan anda akan mengembalikan cip nombor pelik.\r\n</p>\r\n<p>\r\n    3. Zodiak Cina Khusus\r\n</p>\r\n<p>\r\n    ·The order of the zodiac is: rat&gt;ox&gt;tiger&gt;rabbit&gt;dragon&gt;snake&gt;horse&gt;sheep&gt;monkey&gt;chicken&gt;dog&gt;pig\r\n</p>\r\n<p>\r\n    ·Jika kod istimewa dalam tempoh semasa jatuh dalam julat taruhan pada zodiak Cina, ia adalah loteri\r\n</p>\r\n<p>\r\n    4. Gelombang warna istimewa\r\n</p>\r\n<p>\r\n    ·Bola nombor 49 warna Liuhe Super Kelajuan berwarna merah, biru dan hijau. Warna kod istimewa dan warna taruhan adalah warna yang menang. Perwakilan warna adalah seperti ini:\r\n</p>\r\n<p>\r\n    ·Gelombang merah: 01, 02, 07, 08, 12, 13, 18, 19, 23, 24, 29, 30, 34, 35, 40, 45, 46\r\n</p>\r\n<p>\r\n    ·Gelombang biru: 03, 04, 09, 10, 14, 15, 20, 25, 26, 31, 36, 37, 41, 42, 47, 48\r\n</p>\r\n<p>\r\n    ·Gelombang hijau: 05, 06, 11, 16, 17, 21, 22, 27, 28, 32, 33, 38, 39, 43, 44, 49\r\n</p>\r\n<p style=\"white-space: normal;\">\r\n    &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;\r\n</p>\r\n<p style=\"white-space: normal;\">\r\n    <br/>\r\n</p>\r\n<p>\r\n    &nbsp; &nbsp; &nbsp;\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>','1',1701276899),(6,'一分十一选五','一分十一选五','一分十一選五','Choose five','Pilih lima daripada sebelas','/static/caipiao/yfks.png','1440','1','gd11x5',1,NULL,NULL,NULL,NULL,'1',1701276900),(7,'一分幸运农场','一分幸运农场','一分幸運農場','One lucky farm','Satu titik ladang bertuah','/static/caipiao/yfks.png','1440','1','xtxssc',1,NULL,NULL,NULL,NULL,'1',1701276879),(9,'三分快三','三分快三','三分快三','Three points faster than three','Tiga minit berpuasa tiga','/static/caipiao/sfks.png','480','3','f3k3',1,NULL,NULL,NULL,NULL,NULL,1701276880),(14,'五分快三','五分快三','五分快三','Five minutes faster than three','Lima minit puasa tiga','/static/caipiao/wfks.png','288','5','f5k3',1,NULL,NULL,NULL,NULL,NULL,1701276900);
